import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import AppWrapper from './AppWrapper';

window.renderApp = function(userType) {
  ReactDOM.render(
    <React.StrictMode>
      <AppWrapper userType={userType} />
    </React.StrictMode>,
    document.getElementById('react-root')
  );
};
